    "spitm_nm_0004"            : "Non utilis\u00E9",
    "spitm_nm_0005"            : "Non utilis\u00E9",
    "spitm_nm_0006"            : "M\u00E9daille de capitaine",
    "spitm_nm_0007"            : "M\u00E9daille de super galaxie",
    "spitm_nm_0008"            : "Point d\u00E9co",
    "spitm_nm_0009"            : "Fragment rare d'\u00E9volution",
    "spitm_nm_0010"            : "Fragment de pierre secr\u00E8te",
    "spitm_nm_0011"            : "Fragment de gemme",
