    "spitm_nm_0013"            : "Ticket pour passer les concerts",
    "spitm_nm_0014"            : "",
    "spitm_nm_0015"            : "Ticket d'\u00E9change de plaque",
    "spitm_nm_0016"            : "Ticket d'\u00E9change d'am\u00E9lioration de costume",
    "spitm_dsc_0001"           : "Objet utilis\u00E9 pour d\u00E9bloquer des discussions in\u00E9dites sur le SNS.\nLes discussions manqu\u00E9es peuvent \u00EAtre visionn\u00E9es \u00E0 nouveau.\n<color=#8e0529>\u203BCertaines discussions ne peuvent pas \u00EAtre d\u00E9bloqu\u00E9s. </color>",
    "spitm_dsc_0002"           : "Objet qui acc\u00E9l\u00E8re une op\u00E9ration Valkyrie commenc\u00E9e. Si le nombre \nsp\u00E9cifi\u00E9 est utilis\u00E9, l'op\u00E9ration Valkyrie peut \u00EAtre achev\u00E9e.\n<color=#C8087E>\u203BLes op\u00E9rations Valkyries sont d\u00E9bloqu\u00E9s au rang 7.</color>",
    "spitm_dsc_0003"           : "Objet qui permet de restaurer 3 tentatives de la chanson du jour.\n<color=#C8087E>\u203BPeut \u00EAtre utilis\u00E9 lorsque le nombre de tentative \nde la chanson du jour est de 0.</color>",
    "spitm_dsc_0004"           : "Non utilis\u00E9",
    "spitm_dsc_0005"           : "Non utilis\u00E9",
    "spitm_dsc_0006"           : "Une grande m\u00E9daille avec les pens\u00E9es des \nanciens capitaines Macross.\nUn objet qui peut charger la jauge du canon Macross.",
    "spitm_dsc_0007"           : "M\u00E9daille sur laquelle sont grav\u00E9s des symboles galactiques.\nPeut \u00EAtre \u00E9chang\u00E9e contre des objets au magasin Chaos.\n<color=#C8087E>\u203BObtenue aupr\u00E8s de la Super Galactic Alliance LIVE, etc.</color>",
    "spitm_dsc_0008"           : "Pi\u00E8ces de monnaie portant le symbole d'un point d\u00E9co.\nElles peuvent \u00EAtre \u00E9chang\u00E9es contre des \nobjets d\u00E9co au magasin Chaos.",
    "spitm_dsc_0009"           : "Des objets qui, s'ils sont collect\u00E9s en plusieurs exemplaires, \npeuvent \u00EAtre \u00E9chang\u00E9s contre des \nnouveaut\u00E9s rares au magasin Chaos",
    "spitm_dsc_0010"           : "Des objets qui, s'ils sont collect\u00E9s en plusieurs exemplaires, \npeuvent \u00EAtre \u00E9chang\u00E9s contre des \npierres secr\u00E8tes au magasin Chaos",
    "spitm_dsc_0011"           : "Des objets qui, s'ils sont collect\u00E9s en plusieurs exemplaires, \npeuvent \u00EAtre \u00E9chang\u00E9s contre des \ngemmes chance au magasin Chaos",
    "spitm_dsc_0012"           : "Des objets qui, s'ils sont collect\u00E9s en plusieurs exemplaires, \npeuvent \u00EAtre \u00E9chang\u00E9s contre des \ngemmes brillantes au magasin Chaos",
    "spitm_dsc_0013"           : "Il y a une limite au nombre de tickets qui \npeuvent \u00EAtre utilis\u00E9s par jour pour \nsauter les concerts.",
    "spitm_dsc_0014"           : "",
    "spitm_dsc_0015"           : "Billet d'\u00E9change sp\u00E9cial rempli de souvenirs.\nPeut \u00EAtre \u00E9chang\u00E9 contre des plaques au magasin Chaos.",
    "spitm_dsc_0016"           : "Billet d'\u00E9change sp\u00E9cial rempli de souvenirs de costumes.\nPeut \u00EAtre \u00E9chang\u00E9 contre une plaque de costume au magasin Chaos.",
